/* google+ palette - red: #E14836; blu: #1A53F7; yellow: #FFB715; green: #02A617; gray: #2D2D2D;
                     lightblue; #4589F7; darkred: #A3362E; */

/* default behavior transparent background and white text */
body { color: #f5f5f5 !important; background-color: #181818 !important;}


/**************** TOP BAR ****************/

#appbar { background: none repeat scroll 0 0 #181818 !important; }

/* search text results */
span.st, .st { color: #f5f5f5 !important; }
em { color: #E14836 !important; }

/* top bar style */
#gbx4, #gbx2, #gbx3 { background-color: #181818 !important; border-bottom: 1px solid #E14836 !important;}

/* top bar drop down */
.gbmc, #gbgs4 { background-color: #2D2D2D !important; }
.gbm { box-shadow: 0 1px 5px #2D2D2D !important; } 

/* top bar items */
.gbzt-hvr, .gbzt:focus, .gbgt-hvr, .gbgt:focus { background: #E14836 !important; } 
.gbmt-hvr { background: #E14836 !important;}

/* fix for selected toolbar item */
.gbz0l .gbtb2 { border-top-color: #E14836 !important; }
.gbz0l .gbts { color: #E14836 !important; }
.gbts:hover { color: #f5f5f5 !important;}

/**************** SEARCHBOX BAR ****************/

/* search box bar style */
#gbx1, #gbx1.gbqfh { 
    background: none repeat scroll 0 0 #181818 !important;
    border-color: #181818 !important;
    opacity: 1.0 !important;
}

/* social callup and counters */
#gbi1a { border: 1px #333 solid !important}
#gbg1 { border-top: 1px #333 solid !important; border-right: 1px #333 solid !important; }

#gbgs3, #gbi1, #gbi1c {
    color: #f5f5f5 !important;
    background-color: #222 !important;
    background-image: -moz-linear-gradient(center top , #222, #181818) !important;
    border: 1px solid #333 !important;
    text-shadow: 0 1px rgba(0, 0, 0, 0.1) !important;
}

#gbi4t:hover, #gbi4t:active, .gsfs { background-color: #222 !important; }
#gbi4t:hover { color: #f5f5f5 !important; }


#leftnav { background-color: #181818 !important; }

a:link { color: #999 !important; text-decoration: none !important;}
a:hover, a:visited { color: #f5f5f5 !important }

/**************** SETTINGS *****************/
.sect, .goog-slider li {color: #f5f5f5 !important;}


/**************** HOME PAGE ****************/

/* remove home page logo and results page logo */
#logo, #hplogo  { width: 0 !important; } 
#hplogo div {color: #E14836 !important; }

/* home page buttons */
.lsb { background-color: #1a1a1a !important; color: #999 !important; border-color: #181818 !important;}
.lsb:hover, .lsb:active { background-color: #4589F7 !important; color: #f5f5f5 !important;}
.lsbb { background-color: transparent !important; }

input { color: #999 !important;}

input[name="btnK"], input[name="btnI"]
{ background: transparent !important; border: 1px #333 solid !important; color: #999 !important; }

input[name="btnK"], input[name="btnI"]
{ background-color: #4589F7 !important; color: #f5f5f5 !important;}

.jsb input { background-color: transparent !important; color: #999 !important;}
.jsb input:active { background-color: #4589F7 !important; color: #f5f5f5 !important;}

/**************** SEARCH RESULTS ****************/

/* searchbox background */
.sfbg, .sfbgg  { background-color: #181818 !important; border: 1px transparent solid !important; }
.gsib_a { background-color: #181818 !important; border: 1px #333 solid !important; }

#gbqfqw { border: 0px transparent solid !important;}

/* search box style */
.lst-td { background-color: #181818 !important; border: none !important; }
#lst-ib { color: #f5f5f5 !important; }
.lst, .lst-b { background-color: #181818 !important; color: #f5f5f5 !important; border: 1px solid #333 !important; }
.lst-d { background-color: #181818 !important; }
div.lst-d { border: 0px #333 solid !important ;}

/* fixed dropdown search */
div.gac_bt { background-color: #181818 !important;}
div.gac_id { border: 0 !important; }
div.gac_od { border: 0 !important; border-bottom: 2px solid #E14836 !important; border-left: 1px solid #999 !important; border-right: 1px solid #999 !important;}
td.gac_c, td.gac_d { color:#ccc !important; background-color: #181818 !important; }
td.gac_c:hover {color:#f5f5f5 !important; background-color: #4589F7 !important;}


.gssb_a, .gssb_g {
    background-color: #222 !important;
    color: #f5f5f5 !important;
}

.gssb_a:hover {
    background-color: #4589F7 !important;
}


table.gssb_d { background-color: #181818 !important; border-width: 0 1px 0 0 !important; border-color: #2D2D2D !important; color: #f5f5f5 !important;}
table.gssb_e { background-color: #181818 !important; border-width: 0 0 1px 1px !important; border-color: #2D2D2D !important; color: #f5f5f5 !important;}

/* filtered search header */
#tbbc { background-color: #02A617 !important }

/* increase default max-width (1181 px) */
/* #cnt,.sfcc, #tsf  { max-width: 1481px !important; } */
/* .s { max-width: 42em !important; } */

/* search results links */

/* primary link */
h3 > a.l:link { color: #E14836 !important; text-decoration: none !important}
h3 > a.l:hover { color: #E14836 !important; text-decoration: underline !important}
h3 > a.l:visited { color: #A3362E !important; text-decoration: underline !important}

/* secondary link */
a.l:link { color: #02A617 !important; text-decoration: none !important}
a.l:hover { color: #02A617 !important; text-decoration: underline !important}

/* search results footer links */
.osl a:hover { color: #FFB715 !important; }

/* search results cite */
cite { color: #4589F7 !important;} 
cite b { color: #4589F7 !important;} 
cite:hover { color: #4589F7 !important;  border: 0 !important}
a.gl:link { color: #4589F7 !important; text-decoration: none !important; } 
a.gl:hover { text-decoration: underline !important; } 

/* span spell */
.spell { color: #02A617 !important; }

/* search results less important text */
span.f { color: #666 !important; }

/* seach results hover effect */
#cnt.vsh #ires div.vsc:hover > .vspi, #ires div.vso > .vspi, #cnt.vsh #rhs div.vsc:hover > .vspi, #rhs divkls.vso > .vspi {
    background: none repeat scroll 0 0 #2D2D2D !important;
    border: 1px solid #4589F7 !important;
}

/* search result image preview */
#vspb { background-color: #2D2D2D !important; border: 1px solid #2D2D2D !important;}

/* related searches result */
#tbt5 { background-color: #181818 !important; }

/* results snippet */
.lsnip { color: #999 !important;}

/* ads */
#tads { background-color: #181818 !important; border: 1px solid #2D2D2D !important; }
#tads h3 > a:link { color: #E14836 !important;}
#tads h3 > a:hover { text-decoration: underline !important; }
#tads h3 > a:visited { color: #A3362E !important;}
#tads .ac b, #tadsb .ac b, #rhs .ac b { color: #F5F5F5 !important;}
#tads .s, #tadsb .s, #tads .ac, div#tadsb .ac { color: #CCCCCC !important;}

/**************** SIDEBAR ****************/

/* sidebar menu */
#hidden_modes { background-color: #181818 !important; }
.mitem { color: #999 !important; }
.mitem:hover, .kls:hover, .kl:hover, #showmodes:hover { background-color: #2D2D2D !important; }

/* sidebar line separator */
.lnsep { border-color: #E14836 !important; }


/**************** FOOTER ****************/

/* remove Goooooogle navigation images */
span.csb { height: 0 !important; }

#footer > div { border-top: 1px solid #000 !important; }


/* autopager support */
.autoPagerS { background-color: transparent !important; }

/**************** GOOGLE IMAGES ****************/

/* search button */
input[name="btnG"]
{ background-color: transparent !important; border: 0px #333 solid !important; color: #999 !important; }
input[name="btnG"]:hover
{ background-color: transparent !important; border: 0px #333 solid !important; color: #999 !important; }

tr.gssb_i {color:#f5f5f5 !important; background-color: #4589F7 !important;}
.qbip { background-color: #181818 !important; box-shadow: none !important; border-color: #2D2D2D !important }

/* color palette */
.sc { background: #181818 !important; border: 0 !important;}


/**************** GOOGLE VIDEOS ****************/
img[src*=video_logo] { width: 0 !important; height: 0 !important; }
.search-input {background-color: #181818 !important; border-color: #2D2D2D !important; color: #f5f5f5 !important;}

/* fixed dropdown search */
.google-ac-m { border: 0 !important; border-bottom: 2px solid #E14836 !important; border-left: 1px solid #999 !important; border-right: 1px solid #999 !important;}
td.google-ac-c { color:#ccc !important; background-color: #181818 !important; }
td.google-ac-c:hover {color:#f5f5f5 !important; background-color: #4589F7 !important;}


/**************** GOOGLE NEWS ****************/
.basic-title { background-color: #2D2D2D !important; }
.story { background-color: #181818 !important; }
.focused-story { background-color: #2D2D2D !important; }
.sel { color: #4589F7 !important; } 
a:link.article { color: #E14836 !important; } 
a:hover.article { text-decoration: underline !important; } 
a:visited.article { color: #A3362E !important; } 
img[src*="logo/en_us/news.gif"] { width: 0 !important; height: 0 !important; }
/* search input */
.searchField { color: #f5f5f5 !important; border-color: #2D2D2D #2D2D2D #2D2D2D #2D2D2D !important; background-color: #181818 !important; border-width: 1px medium 1px 1px; }
/* dropdown */
.ac-renderer { border: 0 !important; border-bottom: 2px solid #E14836 !important; border-left: 1px solid #999 !important; border-right: 1px solid #999 !important;}
.ac-renderer div { background-color: #181818 !important; }
.ac-renderer div.active { color:#ccc !important; background-color: #2D2D2D !important; }
/* left nav pinned menu */
#left-nav-wrapper, .left-nav-pinned { background-color: #181818 !important; }
/* border of stories */
.blended-wrapper { background-color: #181818 !important; border-bottom: 1px solid #2D2D2D !important; }
/* buttons */
.lsb1 { background: none repeat scroll 0 0 #181818 !important; color: #999999 !important; border-width: 0 0 0 1px !important;}
.lsb1:active { background: none repeat scroll 0 0 #4589F7 !important; color: #f5f5f5 !important;}
#kd-googlebar, .kd-appbar { background: none !important; border-bottom-color: #2D2D2D !important;}
.basic-title { background: none !important; }
span.title, h2.text {color: #4589F7!important; }

/* image replacement */

/* google+1 animation */

/* preview sidebar */
.nyc_opening .vspii, .nyc_open .vspii, .nyc_opening #nycp, .nyc_opening #nycprv { background-color: #181818 !important; border-color: #2D2D2D !important;}
.vspii { background-image: -moz-linear-gradient(center top , #2D2D2D, #181818) !important; border: 0 !important; background-color: #181818 !important;}
 #nycp { background-color: #181818 !important; border-left: 0 !important;}
 #nyccur { background: none repeat scroll 0 0 #181818 !important;}
#nyccur.wipeLeft, #nyccur.wipeRight { border: 0 !important; }

/* various icons */
#vsrs, #vsrsr, #vspci, .eswd, .eswa, .tiny-pin p, .rsw-remove-active, .rsw-starred, .rsw-half-starred, 
.rsw-unstarred, .rsw-angry-active, .rsw-angry-inactive, .rsw-happy-active, .rsw-happy-inactive, 
.csb, .ss, .play_icon, .mini_play_icon, .licon, .close_btn, #tbp, .mbi, .inline_close_btn 
{ background-image: url(data:image/png;base64,) !important; }

.eswe, .eswa:active, .esws, .eswd:hover, .eswh, .eswh:active { background-image: url(data:image/png;base64,) !important;}

